import { LoadScript, GoogleMap, Polyline } from "@react-google-maps/api";

const MapWithPolyline = (Positions) => {

  return (
    <LoadScript googleMapsApiKey={"AIzaSyCjpcBI57XAEzvIqzNBEj4eIpVzRaRe93U"}>
      <GoogleMap
        id="myMap"
        mapContainerStyle={{height: "100vh", width: "80vw"}}
        zoom={18}
        center={{
          lat: 34.48520833, 
          lng: 136.8251525
        }}
        mapOptions={{
          disabledDefaultUI: true, 
          zoomControl: true,
          streetViewControl: false,
          mapTypeControl: false,
        }}
        mapTypeId="satellite" // 地図タイプを航空写真に設定
      >
        {

        }
        <Polyline 
          path={JSON.stringify(Positions)}
          options={{
            strokeColor : "#FFFF00",
            strokeOpacity : 0.8,
            strokeWeight : 1
          }}
        />
      </GoogleMap>
    </LoadScript>
  )
}

export const Map = ({Positions}) => {
  // console.log(Positions);
  return (
    <div>
      <MapWithPolyline Positions={Positions}/>
    </div>
  )
};
